import React from "react";
import AboutMe from "./AboutMe";

const App = () => {
  return (
    <div>
      <h1 style={{ textAlign: "center", margin: "20px 0" }}>Welcome to TerpsCook!</h1>
      <p style={{ textAlign: "center", fontSize: "1.1rem", margin: "10px 20px" }}>
        TerpsCook is a tool designed to make cooking easier and less stressful. With this app, 
        you can generate recipes using the ingredients you already have, reducing waste 
        and helping you save time. We aim to bring creativity and convenience to your kitchen!
      </p>
      <AboutMe />
    </div>
  );
};

export default App;
